import React from 'react'
import './style.scss'

export default (props) => {
  const film = props.value
  console.log(film.id)
  return (
    <li className='content-item'>
      <a className='content-item-name' href='#'>{props.value.title}</a>
      <button
        type='button'
        className='delete-item'
        onClick = {film => props.deleteFilm(film)}
      > </button>
      {/*{props.value.release_year}*/}
      {/*{props.value.format}*/}
      {/*{props.value.stars.join(', ')}*/}
    </li>
  )
}
